function App() {
  return (
    <Fragment>
      <Header></Header>
      <Icons></Icons>
      <ToggleButton></ToggleButton>
      <section className="Intro_sec">
      <Introduction></Introduction>
      </section>
    </Fragment>
  );
}

export default App;
